import React from 'react';
import ParkingSpaceListView from './ParkingManagement/ParkingSpace/ParkingSpaceListView';
import ParkingSpace from './ParkingManagement/ParkingSpace/ParkingSpace';
import ParkingSpaceMapView from './ParkingManagement/ParkingSpace/ParkingSpaceMapView';
import Button from '@material-ui/core/Button';
import ButtonGroup from '@material-ui/core/ButtonGroup';


export default class SolutionAdmin {

    state = {
        card:true,
        list:false,
        map:false

    }

    changeHandler = () => {

        this.setState({
            card:!this.state.card,
            list:!this.state.list,

        })


    }


    render() {

        let {card, list, map } = this.state;

        const print = () => {
            if(card === true){
                return <ParkingSpace />
            }else{
                return <ParkingSpaceListView />
            }
        }

        return (
            <div>
                <ButtonGroup color="secondary" aria-label="outlined secondary button group">
                    <Button id="one" value={this.state.card} onClick={this.changeHandler} >One</Button>
                    <Button id="two" value={this.state.list} onClick={this.changeHandler}>Two</Button>
                    <Button id="three" value={this.state.map} onClick={this.changeHandler}>Three</Button>
                </ButtonGroup>
                {/* <ParkingSpaceMapView />
                <ParkingSpaceListView />
                <ParkingSpace /> */}

            <div>{card = true}</div>
            </div>
        )
    }
}


